text:
 @mindhellll  mania? No último jogo contra o são Paulo a FPF assumiu erro. A mania é; imprensa desmerece o time antes do jogo, o juiz roba em campo, o var finge que não vê, a central do apito assina embaixo.
Olha contra o Coritiba o pênalti do alef manga que não foi marcado. O pênalti contra o Andrey que foi marcado.
É raro um jogo que n aconteça isso. E faz tempo.

